    "AirCore Reusable InSitu Sampler for CO2 and Trace Gas Measurements Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:24:00.429351",nt"name": "aircore-reusable-insitu-sampler-for-co2-and-trace-gas-measurements-project",nt"isopen":
    true,nt"url": null,nt"notes": "A novel design for an in situ air sampling
    sensor for CO2 and trace gases is proposed. The sensor, named AirCore, provides
    the advantages of existing in situ sensors (e.g. high resolution) but eliminates
    possible biases in analysis that often originate from imperfect measurement condition.
    The AirCore provides a significant savings in cost and weight while increasing the
    capabilities of existing in situ sensors. The AirCore system consists of the AirCore
    gas sampler and the support system to accomplish its high altitude (nominally 70,000+
    ft.) mission. This support system includes the sensor launch and recovery components.
    The AirCore can be launched and recovered by a limited crew, which reduces the operational
    cost of the system.",nt"license_title": "U.S. Government Work",nt"extras":
